  +-----------------------------------------------------+
  |                  54 entry scheduler                 |
  +-----------------------------------------------------+
     0 |       1 |      2 |     3 |     4 |      5 |    
       \/        \/       \/      \/      \/       \/   
   +-------+ +-------+ +-----+ +-----+ +-----+ +-------+
   |  ALU  | |  ALU  | |  LD | |  LD | |  ST | |  ALU  |
   +-------+ +-------+ +-----+ +-----+ +-----+ +-------+
   +-------+ +-------+ +-----+ +-----+         +-------+
   |AVX DIV| |  Fast | | AGU | | AGU |         | BRANCH|
   +-------+ |  LEA  | +-----+ +-----+         +-------+
   +-------+ +-------+                         +-------+
   |AVX MUL| +-------++-------+                |  Fast |
   +-------+ |AVX ADD||AVX FMA|                |  LEA  |
   +-------+ +-------++-------+                +-------+
   |  AVX  |+-------+ +-------+                +-------+
   | Shift ||AVX FMA| |AVX MUL|                |  AVX  |
   +-------++-------+ +-------+                |  SHUF |
                                               +-------+
